"use strict";(self.webpackChunkdiscord_resource_wiki=self.webpackChunkdiscord_resource_wiki||[]).push([[880],{8256:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"/2023/10/07/changelog","metadata":{"permalink":"/blog/2023/10/07/changelog","source":"@site/blog/2023-10-07-changelog.md","title":"New maintainer and lead","description":"Announcing our latest news regarding our plans to the future.","date":"2023-10-07T00:00:00.000Z","formattedDate":"7 \u0436\u043e\u0432\u0442\u043d\u044f 2023 \u0440.","tags":[{"label":"changelog","permalink":"/blog/tags/changelog"}],"readingTime":0.415,"hasTruncateMarker":false,"authors":[],"frontMatter":{"title":"New maintainer and lead","description":"Announcing our latest news regarding our plans to the future.","tags":["changelog"]},"nextItem":{"title":"1st Wave Of Languages Is Here!","permalink":"/blog/2022/08/10/changelog"}},"content":"@authors/135877336804360194\\n**Introducing new project maintainer and lead**\\n\\nHello everyone. As you might have noticed, this project has been drifting for some quite time now and getting little to none updates. But that will change today.\\n\\nAs of today, I will be taking over as project lead and maintainer. Nothing major will change.\\n\\nGitHub will be moved to a new org, since the old was locked behind Rydix account and they are no where to be seen.\\n\\nThats pretty much it. Have nice day!"},{"id":"/2022/08/10/changelog","metadata":{"permalink":"/blog/2022/08/10/changelog","source":"@site/blog/2022-08-10-changelog.md","title":"1st Wave Of Languages Is Here!","description":"Announcing our latest news regarding new language support, and our plans to the future.","date":"2022-08-10T00:00:00.000Z","formattedDate":"10 \u0441\u0435\u0440\u043f\u043d\u044f 2022 \u0440.","tags":[{"label":"changelog","permalink":"/blog/tags/changelog"}],"readingTime":1.165,"hasTruncateMarker":false,"authors":[],"frontMatter":{"title":"1st Wave Of Languages Is Here!","description":"Announcing our latest news regarding new language support, and our plans to the future.","tags":["changelog"]},"prevItem":{"title":"New maintainer and lead","permalink":"/blog/2023/10/07/changelog"},"nextItem":{"title":"New Languages Support Coming To The Discord Resources Wiki","permalink":"/blog/2022/05/04/changelog"}},"content":"@authors/378537973215657984\\n**Introducing New Language Support!**\\n\\nWe are more than pleased to announce that the Discord Resources Wiki now supports 3 new languages. Over the past few months, our volunteer translators have worked hard to make our website more accessible to people whose first language isn\'t english, so be sure to thank them in #Chat . Every two months we will have a polish week to update all the languages to the most updated version of the wiki.\\n\\n**The following languages are now available:**\\n> \u2014 \ud83c\udde9\ud83c\uddea ` Deutsch ` <br/>\\n> \u2014 \ud83c\uddea\ud83c\uddf8 ` Espa\xf1ol ` <br/>\\n> \u2014 \ud83c\uddf9\ud83c\uddf7 ` Turkish ` <br/>\\n> \u2014 \ud83c\uddeb\ud83c\uddf7 ` Fran\xe7ais `  <br/>\\n\\n**(HELP WANTED) Upcoming Languages:**\\nOver the next month(s) we will be adding the languages listed below. We are looking for extra translators for all the below languages. Please contact @378537973215657984, if you can help. \\n> \u2014 \ud83c\uddf5\ud83c\uddf9 ` Portuguese (Portugal) ` <br/>\\n> \u2014 \ud83c\uddfa\ud83c\udde6 ` Ukrainian ` <br/>\\n> \u2014 \ud83c\uddee\ud83c\uddf3 ` Hindi `  <br/>\\n> \u2014 \ud83c\uddf3\ud83c\uddf1 ` Dutch ` <br/>\\n> \u2014 \ud83c\uddf3\ud83c\uddf4 ` Norwegian `  <br/>\\n> \u2014 \ud83c\uddf8\ud83c\uddea ` Swedish `  <br/>\\n> \u2014 \ud83c\uddee\ud83c\uddf1 ` Hebrew ` <br/>\\n> \u2014 \ud83c\uddf8\ud83c\udde6 ` Arabic ` <br/>\\n> \u2014 \ud83c\udde7\ud83c\udde9 ` Bengali ` <br/>\\n\\nIf anybody has any question, ask away in [our guild](https://discord.com/invite/AJX6cVWeJg)! And if you notice any issues, feel free to report it or PR it!"},{"id":"/2022/05/04/changelog","metadata":{"permalink":"/blog/2022/05/04/changelog","source":"@site/blog/2022-05-04-changelog.md","title":"New Languages Support Coming To The Discord Resources Wiki","description":"Announcing the begninnig of translation for the website to many new languages.","date":"2022-05-04T00:00:00.000Z","formattedDate":"4 \u0442\u0440\u0430\u0432\u043d\u044f 2022 \u0440.","tags":[{"label":"changelog","permalink":"/blog/tags/changelog"}],"readingTime":0.355,"hasTruncateMarker":false,"authors":[],"frontMatter":{"title":"New Languages Support Coming To The Discord Resources Wiki","description":"Announcing the begninnig of translation for the website to many new languages.","tags":["changelog"]},"prevItem":{"title":"1st Wave Of Languages Is Here!","permalink":"/blog/2022/08/10/changelog"},"nextItem":{"title":"Introducing our latest feature: The Discord Resources Blog","permalink":"/blog/2021/11/08/changelog"}},"content":"@authors/755792681313108018\\n**SEEKING TRANSLATORS**\\n\\nHey Everyone!\\n\\nWe are currently looking for volunteers who would like to contribute to the project though translating the wiki in different languages.\\n\\nYou must speak this language fluently or at a level of C2. If interested, please let us know through our official guild at **discord.gg/resources** in the appropriate thread.\\n\\nIf anybody has any questions, ask away in that same thread too!\\n\\nMore updates regarding translations soontm."},{"id":"/2021/11/08/changelog","metadata":{"permalink":"/blog/2021/11/08/changelog","source":"@site/blog/2021-11-08-changelog.md","title":"Introducing our latest feature: The Discord Resources Blog","description":"@authors/378537973215657984","date":"2021-11-08T00:00:00.000Z","formattedDate":"8 \u043b\u0438\u0441\u0442\u043e\u043f\u0430\u0434\u0430 2021 \u0440.","tags":[],"readingTime":0.62,"hasTruncateMarker":false,"authors":[],"frontMatter":{},"prevItem":{"title":"New Languages Support Coming To The Discord Resources Wiki","permalink":"/blog/2022/05/04/changelog"},"nextItem":{"title":"Search Bar","permalink":"/blog/2021/11/03/changelog"}},"content":"@authors/378537973215657984\\nWe have just released yet another superb feature courtesy of @386861188891279362, our website wizard.  <br/>\\nYou\'ll now be able to find all news regarding the current, and future state of the project, along with more information within the new blog.  <br/>\\nWe look forward to hearing your feedback and ideas about the blog; we might add more to it in the near future! <br/>\\n\\n## STAFF OPENINGS\\n\\n \u2014  **Copywriter** *who will be apart of the community team and help create, review and edit our upcoming blog-posts, announcements and more! If you\'re interested in this, DM* @378537973215657984.  <br/>\\n \u2014  **Marketing Specialist** *who will work on strategic marketing and advertising our project. DM* @755792681313108018 *if you\u2019re interested in this position.*\\n\\n**More Updates Soon**\\nCore Team"},{"id":"/2021/11/03/changelog","metadata":{"permalink":"/blog/2021/11/03/changelog","source":"@site/blog/2021-11-03-changelog.md","title":"Search Bar","description":"The announcement and addition of the search bar which has now been added to the website!","date":"2021-11-03T00:00:00.000Z","formattedDate":"3 \u043b\u0438\u0441\u0442\u043e\u043f\u0430\u0434\u0430 2021 \u0440.","tags":[{"label":"changelog","permalink":"/blog/tags/changelog"}],"readingTime":0.305,"hasTruncateMarker":false,"authors":[],"frontMatter":{"title":"Search Bar","description":"The announcement and addition of the search bar which has now been added to the website!","tags":["changelog"]},"prevItem":{"title":"Introducing our latest feature: The Discord Resources Blog","permalink":"/blog/2021/11/08/changelog"},"nextItem":{"title":"The Discord Resources Wiki Website","permalink":"/blog/2021/11/02/changelog"}},"content":"@authors/378537973215657984\\n\\nHeya all!\\n\\nWe\u2019re so happy to announce that the Discord Resources Wiki website just got a ` Search Bar `!\\nThis means it\'ll be so much easier to navigate between the hundreds of resources on the website.\\nUnfortunately, there are some bugs with the search bar which will hopefully be resolved after we upgrade our system.\\n\\nEnjoy the new changes!"},{"id":"/2021/11/02/changelog","metadata":{"permalink":"/blog/2021/11/02/changelog","source":"@site/blog/2021-11-02-changelog.md","title":"The Discord Resources Wiki Website","description":"Major updates, minor changes and  the announcement of our brand new website.","date":"2021-11-02T00:00:00.000Z","formattedDate":"2 \u043b\u0438\u0441\u0442\u043e\u043f\u0430\u0434\u0430 2021 \u0440.","tags":[{"label":"changelog","permalink":"/blog/tags/changelog"}],"readingTime":1.14,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"The Discord Resources Wiki Website","description":"Major updates, minor changes and  the announcement of our brand new website.","tags":["changelog"]},"prevItem":{"title":"Search Bar","permalink":"/blog/2021/11/03/changelog"}},"content":"@authors/378537973215657984\\n\\n_**MASSIVE CHANGES!**_\\n\\nA lot of things changed the last few days, and today we are super excited to introduce...\\n\\n**The Discord Resources Wiki Website!**  \\n**<https://discordresources.com/>**\\n\\nThe website is synced and managed through the Wiki GitHub, meaning that any changes made on GitHub will automatically update the website! Due to the awesome release of the new website, the GitHub native Wiki will be closed down.\\nThe link to the website will be in the repo\'s readme, so you can still refer people to the repo without any problem whatsoever! The repo still exists, and all stars and shares are appreciated.\\n\\n\x3c!-- truncate --\x3e\\n\\nFuture commits will require a different markdown character for the line break. We previously used `\\\\` though you must now use `<br/>`. There is also the possibility for other markdown inconsistencies between systems (GitHub and Docusaurus). We will be sure to keep you updated on any we find.\\nThe website has links to this Discord server and the GitHub repository in the top right corner, you can also append /github or /discord onto the website URL to access the GitHub repository or discord server!\\n\\nWe are looking forward to hearing all of your feedback regarding the new website!\\nKeep in mind, this is still WIP and we\'re constantly looking and working on improving the site from workflow to branding.\\n\\nThank you everyone for the support!"}]}')}}]);